import logo from "../../images/logo.png";
import {
  BannerWrapper,
  Logo,
  ScrollingText,
  Wrapper,
} from "./styled";
import bg from "../../images/background.png";

export const Top = () => {
  return (
    <Wrapper bg={bg}>
      <Logo src={logo} />
<BannerWrapper>
  <ScrollingText delay="0s">
    Renowacja felg, CNC, Malowanie proszkowe, Piaskowanie ✦    Renowacja felg, CNC, Malowanie proszkowe, Piaskowanie ✦    Renowacja felg, CNC, Malowanie proszkowe, Piaskowanie ✦
  </ScrollingText>
  <ScrollingText delay="20s">
    Renowacja felg, CNC, Malowanie proszkowe, Piaskowanie ✦    Renowacja felg, CNC, Malowanie proszkowe, Piaskowanie ✦    Renowacja felg, CNC, Malowanie proszkowe, Piaskowanie ✦
  </ScrollingText>
</BannerWrapper>

    </Wrapper>
  );
};
